pragma solidity ^0.8.12;

import "hardhat/console.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
// import "@openzeppelin/contracts/token/ERC721/IERC721.sol";

import "./BCTypes.sol";

interface GamesInterface {
    function addPlayer(address _charContractAddress, uint _charId, address _owner) external returns (uint);
    function startGame(uint[] memory _playerIndexes, uint _numPlayers) external;
}

interface CharacterInterface {
    function ownerOf(uint256 tokenId) external view returns (address);
    function characters(uint256 charId) external view returns (BCTypes.Character memory);
    function approve(address to, uint256 tokenId) external;
}

contract Lobby is Ownable {

    GamesInterface games;
    CharacterInterface chars;

    function setGameContract(address _gameContractAddress, address _charContractAddress) public onlyOwner {
        games = GamesInterface(_gameContractAddress);
        chars = CharacterInterface(_charContractAddress);
    }

    // uint public MIN_PLAYERS = 3;
    uint constant MAX_PLAYERS = 4;

    BCTypes.Lobby[] public lobbies;

    mapping(address => uint[]) public addressToLobbies;

    event StartedGame(uint lobbyNumber, uint[] playerIds);

    constructor () {
        // Create the first lobby
        _addLobby();
    }

    function _addLobby() internal {
        BCTypes.Lobby storage newLobby = lobbies.push();
        newLobby.gameStarted = false;
        newLobby.numberOfPlayers = 0;
        newLobby.playerIndexes = new uint[](MAX_PLAYERS);
    }

    function enlistForMission(uint _charId, address charOwner) public {
        // TODO: Create any variant for single player?  Maybe with full party?
        // TODO: and/ or decide on private lobbies
        // TODO: Reimplement getting char address for multiple contracts allowed
        // NOTE: Deliberately not attempting to prevent multi-enlist by one person
        // NOTE: Don't need to check for character ownership/status because of NFT transfer in chars.enlistChar()

        // Create lobby if needed
        BCTypes.Lobby storage newLobby;
        if (lobbies[lobbies.length-1].numberOfPlayers == MAX_PLAYERS) {
            _addLobby();
        }

        newLobby = lobbies[lobbies.length-1];

        // TODO: Validate and Lock item NFTs in contract

        uint playerIndex = games.addPlayer(address(chars), _charId, charOwner);
        newLobby.playerIndexes[newLobby.numberOfPlayers] = playerIndex;
        newLobby.numberOfPlayers++;

        if (newLobby.numberOfPlayers == MAX_PLAYERS) {
            games.startGame(newLobby.playerIndexes, MAX_PLAYERS);
            emit StartedGame(lobbies.length-1, newLobby.playerIndexes);
        }

        addressToLobbies[msg.sender].push(lobbies.length-1);
        // TODO: Event
    }

    function extGetLobbyPlayerIndexes(uint _lobbyId) public view returns (uint[] memory) {
        uint[] memory indexes = new uint[](lobbies[_lobbyId].playerIndexes.length);
        for (uint i = 0; i < indexes.length; i++) {
            indexes[i] = lobbies[_lobbyId].playerIndexes[i];
        }
        return indexes;
    }
}
